import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';
import { packageContact } from '../../utils/HomeData'
const PackageContact = ({ heading }) => {
    return (
        <View>
            <Text style={styles.contactHeading}>{heading}</Text>
            <View style={styles.c_Box}>
                <View style={styles.c_flex}>
                    <View style={styles.flex_one}>
                        <Text>img</Text>
                        <Text>Contact</Text>
                    </View>
                    <View style={styles.flex_two}>
                        <Text>2345678905</Text>
                    </View>
                </View>
                {/* <View style={styles.c_flex}>
                    <View style={styles.flex_one}>
                        <Text>img</Text>
                        <Text>Contact</Text>
                    </View>
                    <View style={styles.flex_two}>
                        <Text>2345678905</Text>
                    </View>
                </View> */}
                {packageContact.map((data) => (
                    <View style={styles.c_flex}>
                        <View style={styles.flex_one}>
                            <Image source={data.icon} style={styles.c_img} />
                            <Text>{data.contacts}</Text>
                        </View>
                        <View style={styles.flex_two}>
                            <Text>{data.conNum}</Text>
                        </View>
                    </View>
                ))}
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    contactHeading: {
        padding: '10px',
        color: "#102C56",
        fontWeight: '600',
        fontSize: '22px',
        lineHeight: "24px",
        letterSpacing: '2%'
    },
    c_Box: {
        height: '100px',
        width: '100vw',
        backgroundColor: "orange",
    },
    c_flex: {
        width: '98vw',
        height: '50px',
        backgroundColor: "#fff",
        margin: 'auto',
        flexDirection: 'row',
        justifyContent: 'space-between',
    },
    flex_one: {
        width: '45vw',
        height: '30px',
        backgroundColor: "#909090",
        margin: '4px',
        flexDirection: 'row',
        justifyContent: 'space-around'
    },
    c_img: {
        width: '28px',
        height: '28px'
    },
    flex_two: {
        width: '60vw',
        height: '30px',
        backgroundColor: "#606060",
        margin: '4px',
    }
})

export default PackageContact;
